PROMPT  == W O R K S P A C E   C O N T E N T 
PROMPT  =============================================================================

DECLARE
  l_workspace     varchar2(20) := 'SERT';
  l_workspace_id  number;
BEGIN

  -- Get the SERT Workspace Name ID value
  select workspace_id
    into l_workspace_id
    from apex_workspaces
    where workspace = l_workspace;
  
    -- apex_util.set_workspace_id( l_workspace_id );
    apex_util.set_security_group_id(p_security_group_id => l_workspace_id);
end;
